import React from "react";
import Container from "@material-ui/core/Container";

function Main() {
  return (
    <main class="main">
      <Container fluid>
        <div style={{ minHeight: "500vh", backgroundColor: "red" }}></div>
      </Container>
    </main>
  );
}

export default Main;
